import styled from '@emotion/styled';
import React from 'react';
import { TextField, Typography, Grid, Button, FormControl, Select, MenuItem } from '@mui/material';

// Define styles using emotion/styled
const StyledFormControl = styled(FormControl)`
  width: 100%;
`;

const StyledSelect = styled(Select)`
  label {
    transform: translate(14px, 12px) scale(1);
  }
`;

const FormContainer = styled.div`
  .radioGroup {
    display: flex;
    justify-content: center;
    margin-bottom: -10px;
  }

  .button {
    margin-top: 20px;
  }
`;

const Form = () => {
  return (
    <FormContainer>
      <Grid container spacing={2}>
        <Grid item xs={10}>
          <Typography align='center' variant='subtitle2' gutterBottom>

          </Typography>
        </Grid>
        <Grid item xs={6}>
          <StyledFormControl fullWidth>
            <Typography variant="body1" color="textSecondary">
              Type
            </Typography>
            <StyledSelect label="Type">
              <MenuItem value="Income">Income</MenuItem>
              <MenuItem value="Expense">Expense</MenuItem>
            </StyledSelect>
          </StyledFormControl>
        </Grid>
        <Grid item xs={6}>
          <StyledFormControl fullWidth>
            <Typography variant="body1" color="textSecondary">
              Category
            </Typography>
            <StyledSelect label="Category">
              <MenuItem value="Business">Business</MenuItem>
              <MenuItem value="Salary">Salary</MenuItem>
            </StyledSelect>
          </StyledFormControl>
        </Grid>
        <Grid item xs={6}>
          <TextField type='number' label='Amount' fullWidth />
        </Grid>
        <Grid item xs={6}>
          <TextField type='date' label='Date' fullWidth />
        </Grid>
        <Button className="button" variant='outlined' color='primary' fullWidth>
          Create
        </Button>
      </Grid>
    </FormContainer>
  );
};

export default Form;
